import './App.css';
import Home from './pages/front/Home';

import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useRoutes,
} from "react-router-dom";

function App() {
  return (
    <Routes>
  <Route path="/" element={<Home />}></Route>
   </Routes>
  );
}

export default App;
